  of the navigation logged with HYPACK Software during survey 2009-002-FA conducted
  in Buzzards Bay and Vineyard Sound by the U.S. Geological Survey offshore of Massachusetts
  in 2009.\",\n\t\"tracking_summary\": {\n\t\t\"total\": 11,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
